"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=a(require("@babel/runtime/helpers/taggedTemplateLiteral")),t=require("lit-html");function a(e){return e&&e.__esModule?e:{default:e}}function n(){var t=(0,e.default)(['\n  <h1>Order, fulfilment, and account receivable management system in <a target="_blank" rel="noreferrer" href="https://www.sigma-global.com/en/">Sigma Corp.</a> (1995-2000)</h1>\n  <p>Initiated the effort of transitioning old, mainframe-based system to Oracle-based one.</p>\n  <ul class="bx--list--unordered as-portfolio--list--unordered">\n    <li class="bx--list__item">Cut not only the hardware cost, but also the maintenance cost (automated the maintenance while the old system required lots of manual maintenance)</li>\n  </ul>\n  <p><bx-tag>Oracle</bx-tag><bx-tag>SQL</bx-tag><bx-tag>Pascal (Delphi)</bx-tag></p>\n  <h2>Learned</h2>\n  <ul class="bx--list--unordered as-portfolio--list--unordered">\n    <li class="bx--list__item">How to negotiate the new idea with various stakeholders</li>\n    <li class="bx--list__item">How to analyze an existing, legacy system and transitioning them to a different technology</li>\n  </ul>\n']);return n=function(){return t},t}require("carbon-custom-elements/es/components/tag/tag");var l=(0,t.html)(n());exports.default=l;
