"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=i(require("@babel/runtime/helpers/taggedTemplateLiteral")),t=require("lit-html"),n=i(require("carbon-custom-elements/es/icons/jump-link/32"));require("carbon-custom-elements/es/components/tag/tag");var a=i(require("./carbon-letter.jpg"));function i(e){return e&&e.__esModule?e:{default:e}}function o(){var t=(0,e.default)(['\n  <h1>\n    IBM Cloud core console (2016-2017)\n    <a class="as-portfolio--product-link" target="_blank" rel="noreferrer" href="https://www.ibm.com/cloud/blog/announcements/introducing-bluemix-developer-console" title="Jump to product information">','</a>\n  </h1>\n  <p>Led/helped developers in Toronto/ON, Austin/TX and China on best practices of the following areas:</p>\n  <ul class="bx--list--unordered as-portfolio--list--unordered">\n    <li class="bx--list__item">Front-end performance</li>\n    <li class="bx--list__item">Front-end API; My effort in this area led to a collaboration with Bluemix Style Guide team that led to a inception of Bluemix Design System, which eventually became IBM <a href="./?page=carbon-design-system" data-nav-name="carbon-design-system">Carbon Design System</a></li>\n    <li class="bx--list__item">Unit/functional tests</li>\n    <li class="bx--list__item">Efficient development workflow</li>\n    <li class="bx--list__item">Latest web standards</li>\n  </ul>\n  <p>\n    <bx-tag>JavaScript</bx-tag>\n    <bx-tag>CSS</bx-tag>\n    <bx-tag>HTML</bx-tag>\n    <bx-tag>React</bx-tag>\n    <bx-tag>Polymer</bx-tag>\n    <bx-tag>node.js</bx-tag>\n    <bx-tag>IBM Cloud</bx-tag>\n  </p>\n  <h2>Highlights</h2>\n  <div class="as-portfolio--card-list">\n    <div class="as-portfolio--card">\n      <div class="as-portfolio--card__title-pictogram-container">\n        <svg focusable="false" preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg" width="35%" height="35%" viewBox="0 0 48 48" aria-hidden="true" style="will-change: transform;"><path fill="none" stroke="#000" stroke-miterlimit="10" stroke-width=".72" d="M26.5,24 c0,1.381-1.119,2.5-2.5,2.5s-2.5-1.119-2.5-2.5s1.119-2.5,2.5-2.5S26.5,22.62,26.5,24z M36.5,21.5c-1.381,0-2.5,1.119-2.5,2.5 s1.119,2.5,2.5,2.5S39,25.381,39,24S37.881,21.5,36.5,21.5z M11.5,21.5C10.119,21.5,9,22.62,9,24s1.119,2.5,2.5,2.5 S14,25.381,14,24S12.881,21.5,11.5,21.5z M15.335,33.25c-0.69,1.196-0.281,2.724,0.915,3.414c1.196,0.69,2.724,0.281,3.414-0.915 c0.69-1.196,0.281-2.724-0.915-3.414C17.554,31.645,16.025,32.055,15.335,33.25z M28.335,33.25 c-0.69,1.196-0.281,2.724,0.915,3.414c1.196,0.69,2.724,0.281,3.414-0.915c0.69-1.196,0.281-2.724-0.915-3.414 C30.554,31.645,29.026,32.055,28.335,33.25z M15.335,14.75c0.69,1.196,2.219,1.605,3.414,0.915c1.196-0.69,1.605-2.219,0.915-3.414 s-2.219-1.605-3.414-0.915C15.054,12.026,14.645,13.554,15.335,14.75z M28.335,14.75c0.69,1.196,2.219,1.605,3.414,0.915 c1.196-0.69,1.605-2.219,0.915-3.414c-0.69-1.196-2.219-1.605-3.414-0.915C28.055,12.026,27.645,13.554,28.335,14.75z"></path><title>Networking 01</title></svg>\n      </div>\n      <h2>Scaling UI development</h2>\n      <p>\n        In early days of Bluemix, it was difficult to figure out what to do with tabs, what to do with selectors, what to do with side navs, etc.\n        I quickly knew that Bluemix needed UI guide and standard UI component library.\n        I jumped into the effort that was starting in Austin to make their JavaScript code resuable and robust, which eventually became IBM <a href="./?page=carbon-design-system" data-nav-name="carbon-design-system">Carbon Design System</a>.\n      </p>\n      <h3>Lessons learned and actions taken</h3>\n      <p>\n        Learned how to find a great initiative, accelerate it, and guide the team/effort toward success.\n        Also learned how to incrementally transition a codebase to its ideal state, avoiding risky rip-and-replace/breaking changes.\n        That has become my primary approach of improving codebase of various teams.\n      </p>\n    </div>\n    <div class="as-portfolio--card">\n      <div class="as-portfolio--card__title-pictogram-container">\n        <svg focusable="false" preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg" width="35%" height="35%" viewBox="0 0 48 48" aria-hidden="true" style="will-change: transform;"><path fill="none" stroke="#000" stroke-linejoin="round" stroke-miterlimit="10" stroke-width=".72" d="M24,31c-3.866,0-7-3.134-7-7s3.134-7,7-7s7,3.134,7,7S27.866,31,24,31z M21.839,30.66l3.553-3.352 c0.193-0.182,0.236-0.472,0.103-0.702l-2.687-4.667c-0.133-0.231-0.089-0.522,0.105-0.704l1.858-1.737 c0.195-0.182,0.238-0.474,0.105-0.704l-1.035-1.792 M20.498,30.062l1.236-2.137c0.102-0.177,0.103-0.395,0-0.573l-0.671-1.163 c-0.133-0.23-0.09-0.521,0.104-0.703l1.016-0.955c0.194-0.182,0.236-0.473,0.104-0.703l-0.758-1.313 c-0.102-0.177-0.291-0.286-0.496-0.286h-1.845c-0.204,0-0.393-0.109-0.495-0.285l-0.796-1.371 M29.432,19.634l-1.439,2.507 c-0.101,0.177-0.101,0.394,0,0.57l1.117,1.942c0.102,0.178,0.291,0.287,0.496,0.287h1.314 M28.43,35.7c3.34-1.27,6-3.93,7.26-7.27 M12.31,28.43c1.26,3.34,3.92,6,7.26,7.27 M35.69,19.57c-1.27-3.34-3.92-5.99-7.26-7.26 M19.57,12.31 c-3.34,1.27-5.99,3.92-7.26,7.26 M24,34c-1.381,0-2.5,1.119-2.5,2.5S22.619,39,24,39s2.5-1.119,2.5-2.5S25.381,34,24,34z M24,9 c-1.381,0-2.5,1.119-2.5,2.5S22.619,14,24,14s2.5-1.119,2.5-2.5S25.381,9,24,9z M11.5,21.5C10.119,21.5,9,22.619,9,24 s1.119,2.5,2.5,2.5S14,25.381,14,24S12.881,21.5,11.5,21.5z M36.5,21.5c-1.381,0-2.5,1.119-2.5,2.5s1.119,2.5,2.5,2.5 S39,25.381,39,24S37.881,21.5,36.5,21.5z"></path><title>Global network</title></svg>\n      </div>\n      <h2>Open-source-style development</h2>\n      <p>\n        People in IBM started noticing my effort of Bluemix UI component library (later IBM <a href="./?page=carbon-design-system" data-nav-name="carbon-design-system">Carbon Design System</a>), given it was internal open-source.\n        One of them is IBM accessibility team. They reached out to me as they wanted an early adopter of the CI integration of their accessibility test toolstack.\n        I offered my help by implementing early integration of their tool, and reported lots of false-positives in their accessibility-compliance-scan engine.\n      </p>\n      <h3>Lessons learned and actions taken</h3>\n      <p>\n        Lerned the importance of open-source-style development for cross-polinating knowledge, as it fosters new style of collaboration across teams.\n        I started trying to help out more teams in open-source-style collaboration since then.\n      </p>\n    </div>\n    <div class="as-portfolio--card">\n      <div class="as-portfolio--card__title-pictogram-container">\n        <svg focusable="false" preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg" width="35%" height="35%" viewBox="0 0 48 48" aria-hidden="true" style="will-change: transform;"><path fill="none" stroke="#000" stroke-miterlimit="10" stroke-width=".72" d="M37 24.5c0-1.434-.865-2.663-2.099-3.204C34.961 21.039 35 20.775 35 20.5c0-1.434-.865-2.663-2.099-3.204C32.961 17.039 33 16.775 33 16.5c0-1.4-.828-2.94-2.016-3.5-.124-1.66-1.605-3-3.484-3-1.933 0-3.5 1.567-3.5 3.5v22c0 1.933 1.567 3.5 3.5 3.5 1.777 0 3.229-1.33 3.454-3.046C32.67 35.729 34 34.277 34 32.5c0-.22-.026-.434-.065-.643 1.476-.411 2.565-1.75 2.565-3.357 0-.597-.164-1.151-.428-1.643C36.643 26.234 37 25.411 37 24.5zM11 24.5c0-1.434.865-2.663 2.099-3.204C13.039 21.039 13 20.775 13 20.5c0-1.434.865-2.663 2.099-3.204C15.039 17.039 15 16.775 15 16.5c0-1.4.828-2.599 2.016-3.159C17.101 11.483 18.621 10 20.5 10c1.933 0 3.5 1.567 3.5 3.5v22c0 1.933-1.567 3.5-3.5 3.5-1.777 0-3.229-1.33-3.454-3.046C15.33 35.729 14 34.277 14 32.5c0-.22.026-.434.065-.643-1.476-.411-2.565-1.75-2.565-3.357 0-.597.164-1.151.428-1.643C11.357 26.234 11 25.411 11 24.5z"></path><path fill="none" stroke="#000" stroke-linecap="round" stroke-miterlimit="10" stroke-width=".72" d="M28 13L30.984 13M24 14c0 2.026 1 3 3 3M24 20c0-2.026-1-3-3-3M32.901 17.296C31.802 18.217 31 19 31 20v3M19.099 34C20.198 34.921 21 35.704 21 36.704v2M31 20L28 20M33 27L36.072 27M28 28c0 1.482.56 2 1.935 2l1.009-.011c1.609-.016 2.431.48 2.991 1.869M19 29c.5 1.5 1.5 2 2.5 2l2.484-.011M30.001 33.263C30.597 33.824 31 34.607 31 35.954M27 33c-2 0-3 0-3 2M25 38L27 36M28 24c-2 0-1 .986-4 .986-2 0-1.5 1.514-4 1.014M18 14.164L17.016 13.341M15.099 17.296L17 19.71C17.725 20.59 18.175 21 19 21h2M16 23L18 21M15 27L11.928 27M16 31L14.065 31.857"></path><title>Intelligence</title></svg>\n      </div>\n      <h2>Scaling the knowledge</h2>\n      <p>\n        Most of the tests in Bluemix teams were slow and unreliable as they are done with complex integration/dependencies.\n        I advocated for test in more isolated manner, which is, making tests focus on small API set and mocking out everything else.\n        I presented such idea to the team, including how to, along with some popular libraries, to achieve that. I also directly set up unit tests for some of the teams.\n      </p>\n      <h3>Lessons learned and actions taken</h3>\n      <p>\n        Learned the importance of scaling the knowledge and how to do that.\n        I applied similar approach to front-end performance area after then.\n      </p>\n    </div>\n  </div>\n  <figure>\n    <img src="','" width="640">\n    <figcaption>Thank you latter for my Bluemix UI component library (later IBM <a href="./?page=carbon-design-system" data-nav-name="carbon-design-system">Carbon Design System</a>) effort</figcaption>\n  </figure>\n']);return o=function(){return t},t}var s=(0,t.html)(o(),(0,n.default)(),a.default);exports.default=s;
